useState It returns an array with 2 elements first element is the current state value and second element is the function to update the state. State is used to store and manage data that can change over time, such as user input, API responses, or the current state of a component. Note : We need to use state to trigger re-render ,otherwise suppose we are doing the samething using pure js we had to come up with our own logic to trigger re-render. Triggering re-render manually using vanilla js const App = () => { let count = 0; const handleClick = () => { count += 1; console.log(count); let k = document.getElementById('changeme'); k.innerHTML = `${count}`; }; return ( <> <h1 id="changeme">{count}</h1> <button type="button" onClick={handleClick}> click </button> </> );
}; export default App; Basic useState example using counter import { useState } from 'react'; const App = () => { const [count, setCount] = useState(0); const handleClick = () => { // We trigger re-render on updates and value is preserved setCount((c) => c + 1); // Can pass any values and any name }; return ( <> <h1>{count}</h1> <button type="button" onClick={handleClick}> click </button> </> );
}; export default App; Intial render and re-render In a React application, the initial render is the first time that the component tree is rendered to the DOM. It happens when the application first loads, or when the root component is first rendered. This is also known as "mounting" the components. Re-renders, on the other hand, happen when the component's state or props change, and the component needs to be updated in the DOM to reflect these changes. React uses a virtual DOM to optimize the process of updating the actual DOM, so that only the necessary changes are made. There are a few ways that you can trigger a re-render in a React component: By changing the component's state or props. When the component's state or props change, React will re-render the component to reflect these changes. When the parent element re-renders, even if the component's state or props have not changed. Hooks rules starts with "use" (both custom and react inbuilt hooks) must be invoked inside a component dont call hooks conditionally set function do not update immediately. Do not expect synchronous behaviour. use the count function above log the value in handleClick function to verify. Basic array clearAll and clearOne example with useState import { useState } from 'react'; const App = () => { const data = [ { name: 'abc', id: 1 }, { name: 'def', id: 2 }, { name: 'hello', id: 3 } ]; const [people, setPeople] = useState(data); const clearAll = () => { setPeople([]); }; const clearOne = (id) => { const newData = people.filter((p) => { return p.id != id; }); setPeople(newData); }; return ( <> {people.map(({ name, id }, idx) => { return ( <div key={id}> <h1>{name}</h1> <button type="button" onClick={() => { clearOne(id); }} > Delete </button> </div> ); })} <br /> <button type="button" onClick={clearAll}> Delete all </button> </> );
}; export default App; Automatic Batching In React, "batching" refers to the process of grouping multiple state updates into a single update. This can be useful in certain cases because it allows React to optimize the rendering of your components by minimizing the number of DOM updates that it has to perform. By default, React uses a technique called "auto-batching" to group state updates that occur within the same event loop into a single update. This means that if you call the state update function multiple times in a short period of time, React will only perform a single re-render for all of the updates. React v18 ensures that state updates invoked from any location will be batched by default. This will batch state updates, including native event handlers, asynchronous operations, timeouts, and intervals. Cyclic behaviour with objects import { useState } from 'react'; const App = () => { const data = [ { name: 'abc', id: 1 }, { name: 'def', id: 2 }, { name: 'hello', id: 3 } ]; const [idx, setIdx] = useState(0); const [people, setPeople] = useState(data[idx]); const length = data.length; return ( <div> <h1>{people.name}</h1> <button type="button" onClick={() => { let newIdx = (idx + 1) % length; setIdx(newIdx); setPeople(data[newIdx]); }} > Show {data[(idx + 1) % length].name} </button> </div> );
}; export default App; Getting old values By default react will grab old values and increase it by 1 in the setTimeout function. Because in the 3 seconds timespan the setvalue function is still referencing the old value i.e. 0 so to fix it we use a callback.We typically use this callback if we have some functionality which dependes on latest value. To simulate that synchronous beahviour we do as it is below. To preserve the value we use the callback , the value does not gets preserved if no callback is used. The reason why in your code the log function logs an outdated value is because of closure - the count value is a const, and it is set when the component is first rendered. So when you click the button, the value of count is not the new value, but the one it was when it was first rendered (i.e. -> always going to be one less than you expect). [When inside function it will have the same value as it had in its first render] Refer closures Issue In this code, log happens on every re-render. Since clicking the button calls setCount, the state changes, and a re-render occurs. When that happens, the log is executed, and you get the latest value React hooks do not update value immediately React hooks do not update values immediately because of the way they are designed to work. When a state value is updated using hooks, React schedules a re-render of the component. During this re-render, the updated value is applied to the component and any subsequent code that relies on the updated value is executed. If you need to perform some action immediately after a state update, you can use the useEffect hook to run side effects after the component has rendered with the updated values. fixed import { useState, useEffect } from 'react'; const App = () => { const [count, setCount] = useState(0); const handleCLick = () => { setCount((oldval) => oldval + 1); // this will work and get the latest value console.log(count); // will not work still }; console.log(count); // will work return ( <> <div> <h1>{count}</h1> <button type="button" onClick={handleCLick}> click </button> </div> </> );
}; export default App; Example with setTimeout import { useState } from 'react'; const App = () => { const [count, setCount] = useState(0); const handleClick = () => { setTimeout(() => { // will reference old value // setCount(count + 1); // will reference latest value and preserve value between renders // must use return statement setCount(oldval => oldval + 1; ); }, 3000); }; return ( <> <h1>{count}</h1> <button type="button" onClick={handleClick}> click </button> </> );
}; export default App; useEffect useEffect is a hook in React that allows you to perform side effects in function components.There is no need for urban dictionary - basically any work outside of the component. Some Its a way of telling react what to do on component re-render. Perform side-effects i.e actions that occur outside the DOM. examples of side effects are: subscriptions, fetching data, directly updating the DOM, re-registering and de-registering event listeners, timers, etc. Note : If you a noramal JS function and calling it inside a component it will re-run after every re-render import { useState, useEffect } from 'react'; const App = () => { const [count, setCount] = useState(0); const handleCLick = () => { setCount((oldval) => oldval + 1); console.log(count); }; const hello = () => { console.log('hello'); //setCount(count + 1); // cause inifinite re-reender }; // will get called after re-renders hello(); return ( <> <div> <h1>{count}</h1> <button type="button" onClick={handleCLick}> click </button> </div> </> );
}; export default App; accepts two arguments (second optional) first argument - callback function second argument — dependency array by default runs on each render (initial and re-render) cb can't return promise (so can't make it async) dont make the callback of useEffect async ever if dependency array empty [I runs only on initial render] Why use it useEffect is used in React to perform side effects in functional components. Side effects are actions that occur outside of the component, such as fetching data from an API, subscribing to events, or manipulating the DOM. The useEffect hook allows you to specify a function that will be executed after every render of the component. This function can perform any necessary side effects. It can also return a cleanup function that will be executed before the component is unmounted or before the next render. By using useEffect, you can ensure that side effects are only performed when necessary and avoid unnecessary re-renders. It helps to keep the component's logic organized and separate from the rendering logic. Why useEffect runs twice {You will see this behaviour while fetching and logging data from API}? component appears more than once in a page somehting higher up the tree is unmounting and remounting reaact strictmode is on useEffect fetch data from an API import { useState, useEffect } from 'react'; const App = () => { const URL = 'https://api.github.com/users'; const [people, setPeople] = useState([]); useEffect(() => { const getData = async () => { const data = await fetch(URL); const resp = await data.json(); return resp; }; getData().then((data) => { console.log(data); setPeople(data); }); }, []); return ( <> <div> {people.map(({ login, avatar_url }, idx) => { return ( <div key={idx}> <img src={avatar_url} alt={login} width={'100px'} /> <h1 key={idx}>{login}</h1> </div> ); })} </div> </> );
}; export default App;

