The useCallback hook is a hook in React that allows you to memoize a function. It takes two arguments: the first is the function you want to memoize, and the second is an array of dependencies. The hook will return a memoized version of the function that only changes if one of the values in the dependency array changes. By memoizing the function, you can avoid unnecessary re-renders and improve the performance of your React application. The function will only be re-created if one of its dependencies changes, otherwise the same instance of the function will be returned. This can be useful in situations where you have an expensive function that you only want to recompute when its dependencies change. We will notice a gotcha by creating a removePerson function on App.jsx , we will see even after with React.memo child component re-renders again.This is happens beacuse when parent component re-renders on state change in our case when we type input value the removePerson is created from scratch so as a result when removePerson is passed down as a prop to another child component it trigger re-renders as the prop changed Wihout Fix const removePerson = (id) => { const newPeople = people.filter((person) => person.id !== id); setPeople(newPeople);
}; Fix useCallback( (id) => { const newPeople = people.filter((person) => person.id !== id); setPeople(newPeople); }, [people]
); useCallback - Common Use Case What happens if we keep dependency array as FetchData in the useEffect is we will encounter inifinite re-renders as the fetchData is created from scratch.To fix this and still use fetchData as dependency we can use useCallback to create the function only on initial re-render.Another fix is to not use useCallback and remove fetchData from dependency. import { useState, useEffect, useCallback } from 'react';
const url = 'https://api.github.com/users'; const FetchData = () => { const [users, setUsers] = useState([]); const fetchData = useCallback(async () => { try { const response = await fetch(url); const users = await response.json(); setUsers(users); } catch (error) { console.log(error); } }, []); useEffect(() => { fetchData(); }, [fetchData]); // rest of the logic
};

