What are middlewares in nodejs function that sits between the client and server and performs some operations on the incoming request or outgoing response. It can modify the request/response, add new properties to them, or perform some other tasks before passing them to the next middleware Middleware is used to handle common tasks such as authentication, logging, error handling, and more. handles a specific task or set of tasks during the request-response cycle of an HTTP server Middleware basics const express = require('express'); const app = express(); // Express will pass the req,res,next to this middleware function automatically
const logger = (req, res, next) => { // Appending a useful value to request object req.user = 'johndoe'; // Pass the control to the next middlewares next();
}; app.get('/', logger, (req, res) => { // Printing what middleware appended console.log(req.user); res.send('<h1>hello</h1>');
}); app.listen(5000, (req, res) => { console.log('Started ....');
}); Multi Middleware const express = require('express'); const app = express(); // Express will pass the req,res,next to this middleware function automatically
const logger = (req, res, next) => { console.log('Logger1'); // Pass the control to the next middlewares next();
}; const logger2 = (req, res, next) => { console.log('Logger2'); // Pass the control to the next middlewares next();
}; // Array is used for multi middlewares
app.get('/', [logger, logger2], (req, res) => { res.send('<h1>hello</h1>');
}); app.listen(5000, (req, res) => { console.log('Started ....');
}); All Routes Middleware const express = require('express'); const app = express(); const logger = (req, res, next) => { console.log(req.url); next();
}; // Will be used by all routes
app.use(logger); app.get('/', (req, res) => { res.send('<h1>hello</h1>');
}); app.get('/api/hello', (req, res) => { res.send('<h1>hello</h1>');
}); app.get('/api/hello/world', (req, res) => { res.send('<h1>hello</h1>');
}); app.all('*', (req, res) => { res.send('<h1>not found!</h1>');
}); app.listen(5000, (req, res) => { console.log('Started ....');
}); Route specific Middleware const express = require('express'); const app = express(); const logger = (req, res, next) => { console.log(req.url); next();
}; // Will be used by all routes starting with "/api"
app.use('/api', logger); app.get('/', (req, res) => { res.send('<h1>hello</h1>');
}); app.get('/xyz', (req, res) => { res.send('<h1>hello</h1>');
}); // logger will be used here
app.get('/api/hello', (req, res) => { res.send('<h1>hello</h1>');
}); // logger will be used here
app.get('/api/hello/world', (req, res) => { res.send('<h1>hello</h1>');
